import React from "react";

function WordList(props) {
  return (
    <div className="table">
      <table>
        <tr>
          <th>WORD</th>
        </tr>
        <tr>
          <th>{props.word}</th>
        </tr>
      </table>
    </div>
  );
}
export default WordList;
